import "./styles/MenuBar.css";
import logo from './logo.svg'
const MenuBar = () => {
  return (
    <div>
      <header>
        <img src={logo} alt="menu"/>
        <ul className="menu-bar">
          <li>ABOUT</li>
          <li>EXPERIENCE</li>
          <li>EDUCATION</li>
          <li>SKILL</li>
          <li>INTERESTS</li>
        </ul>
      </header>
    </div>
  );
};

export default MenuBar;
